css:
.debugger-container {
  display: flex;
}
.debugger-root {
  display: flex;
  flex-direction: column;
  flex: 1;
  min-width: 0;
  padding: 16px;
}
.debugger-root select.form-control {
  color: #666d81;
  background-color: #333F4A;
  border-color: #1E2329;
}
.debugger-root .control-bar {
  display: flex;
  flex-direction: row-reverse;
}
.debugger-root .inspector {
  display: flex;
  flex-direction: column;
  flex: 1;
}
.debugger-container-old-enabled {
  display: flex;
  flex-grow: 1;
}
.debugger-container-new {
  flex-grow: 1;
  flex-basis: 0;
  overflow: auto;
  padding-right: 0.5em;
  display: flex;
  flex-direction: column;
}
.debugger-container-new span {
  -webkit-user-select: initial;
}
.debugger-container-new-disabled {
  opacity: 0.5;
}
.debugger-state-notice {
  color: #b7c5d3;
  font-weight: bold;
  padding-top: 1.0em;
  padding-bottom: 0.5em;
  text-align: center;
}
.debugger-target-description {
  color: #b7c5d3;
  padding-bottom: 0.5em;
  text-align: center;
  font-size: 8pt;
}
.debugger-section-header {
  padding: 0px 5px;
}
.debugger-controls-section {
  border: 1px #2a2f38 solid;
  padding-top: 5px;
  padding-bottom: 5px;
}
/* General debugger UI */
.debugger-starting-message {
  align-items: baseline;
  display: flex;
  justify-content: space-between;
  margin-bottom: 16px;
  padding: 5px;
}
.debugger-section-content {
  max-height: 20em;
  overflow-y: visible;
  overflow-x: visible;
  margin-bottom: 5px;
}
.debugger-pane-content {
  max-height: 20em;
  overflow-y: visible;
  overflow-x: visible;
  margin-bottom: 5px;
  padding: 10px;
}
.debugger-breakpoint {
  padding-left: 0.25em;
  position: relative;
}
.debugger-breakpoint span {
  -webkit-user-select: none;
}
.debugger-breakpoint-condition {
  font-size: 8pt;
  padding: 3px 0px 3px 25px;
  color: #ebbf83;
}
.debugger-breakpoint-condition .icon {
  height: 8px;
}
.debugger-breakpoint-hitcount {
  font-size: 8pt;
  padding: 3px 0px 3px 25px;
  color: #8bd49c;
}
.debugger-breakpoint-unresolved {
  text-decoration: line-through;
}
.debugger-breakpoint-checkbox {
  padding: 3px;
}
.debugger-breakpoint-disabled {
  text-decoration: line-through;
}
.debugger-breakpoint-with-condition {
  color: #ebbf83;
}
.debugger-breakpoint-condition {
  font-size: 8pt;
  padding: 3px 0px 3px 25px;
  color: #ebbf83;
}
/* Watch Expressions */
.debugger-expression-value-list {
  margin: 0 0.5em;
}
.debugger-expression-value-row {
  display: flex;
  flex-direction: row;
  font-family: Menlo, Monaco, Consolas, monospace;
  justify-content: space-between;
  min-height: 23px;
  overflow: visible;
  position: relative;
}
.debugger-expression-value-content {
  display: flex;
  flex-direction: row;
  flex-grow: 1;
  overflow-x: visible;
}
.debugger-watch-expression-value-content {
  width: 100%;
  overflow: visible;
}
.debugger-scopes-view-controls {
  opacity: 0;
  position: absolute;
  right: 0;
  top: 0;
  background-color: #1a2026;
  padding-left: 4px;
  padding-right: 4px;
}
.debugger-scopes-view-edit-control {
  cursor: pointer;
  color: #b7c5d3;
}
.debugger-scopes-view-edit-control::before {
  margin-right: 0px;
  text-align: center;
}
.debugger-scopes-view-edit-control:hover {
  opacity: 1;
  color: #b7c5d3;
}
.debugger-scope:hover {
  background-color: #1a2026;
}
.debugger-scope:hover .debugger-scopes-view-controls {
  opacity: 1;
  color: rgba(183, 197, 211, 0.5);
}
.debugger-watch-expression-controls {
  opacity: 0;
  position: absolute;
  right: 0;
  top: 0;
  background-color: #1a2026;
  padding-left: 4px;
  padding-right: 4px;
}
.debugger-watch-expression-control {
  cursor: pointer;
  color: #b7c5d3;
}
.debugger-watch-expression-control.icon::before {
  margin-right: 0px;
  text-align: center;
}
.debugger-breakpoint-condition-controls {
  opacity: 0;
  position: absolute;
  right: 0;
  top: 0;
  bottom: 0;
  display: flex;
  align-items: center;
  background-color: #1a2026;
  padding-left: 4px;
  padding-right: 4px;
}
.debugger-breakpoint-condition-control {
  cursor: pointer;
  color: #b7c5d3;
  padding-left: 4px;
}
.debugger-breakpoint-condition-control.icon::before {
  margin-right: 0px;
  text-align: center;
}
.debugger-breakpoint-condition-control.debugger-breakpoint-condition-control:hover {
  opacity: 1;
  color: #b7c5d3;
}
.debugger-breakpoint:hover {
  background-color: #1a2026;
}
.debugger-breakpoint:hover .debugger-breakpoint-condition-controls {
  opacity: 1;
  color: rgba(183, 197, 211, 0.5);
}
.debugger-watch-expression-row:hover {
  background-color: #1a2026;
}
.debugger-watch-expression-row:hover .debugger-watch-expression-controls {
  opacity: 1;
  color: rgba(183, 197, 211, 0.5);
}
.debugger-watch-expression-controls.debugger-watch-expression-controls:hover {
  opacity: 1;
  color: #b7c5d3;
}
.debugger-watch-expression-input {
  margin-left: -0.5em;
}
.debugger-watch-expression-add-new-input {
  margin-top: 0.5em;
}
/* Call stack */
.debugger-callstack-item {
  display: flex;
  justify-content: space-between;
  cursor: pointer;
}
.debugger-callstack-item:hover {
  color: #b7c5d3;
}
.debugger-callstack-item-selected {
  color: #b7c5d3;
  font-weight: bold;
}
.debugger-callstack-list-empty {
  font-style: italic;
  padding: 1em;
  text-align: center;
}
.debugger-callstack-name {
  font-family: Menlo, Monaco, Consolas, monospace;
}
/* Stepping controls */
.debugger-stepping-button-separated {
  margin-left: 10px;
  margin-right: 10px;
}
.debugger-stepping-component {
  display: flex;
  flex-wrap: wrap;
}
.debugger-stepping-svg-button div {
  width: 10px;
}
.debugger-stepping-svg-button svg {
  width: 20px;
  fill: #666d81;
  margin: 0 auto;
  position: relative;
  left: -5px;
  vertical-align: baseline;
  top: 3px;
}
.debugger-stepping-svg-button svg:hover {
  fill: #b7c5d3;
}
.debugger-stepping-playpause-button {
  width: 10px;
  text-align: left;
}
.debugger-stepping-playpause-button-loading {
  position: relative;
  left: -2px;
}
.debugger-stepping-buttongroup {
  margin-right: 1em;
}
.debugger-exception-checkbox {
  cursor: pointer;
}
.debugger-set-source-path-button {
  position: relative;
  left: 10px;
}
.debugger-exception-fragment {
  margin: 5px 0 0 0.5em;
}
/* Thread list */
.debugger-thread-list-item-selected {
  color: #b7c5d3;
  font-weight: bold;
}
.debugger-thread-list-empty {
  font-style: italic;
  padding: 1em;
  text-align: center;
}
.debugger-thread-list-item-current-indicator {
  text-align: center;
}
/* Thread switch datatip */
.debugger-thread-switch-alert {
  padding: 1px 4px;
  font-weight: bold;
  color: #ebbf83;
}
.debugger-thread-loading {
  text-align: center;
  width: 100%;
  height: 100%;
  display: flex;
  justify-content: center;
}
/* Breakpoint config dialog */
.debugger-bp-config-header {
  align-items: baseline;
  margin-bottom: 1em;
  text-overflow: ellipsis;
  width: 100%;
}
.debugger-bp-config-actions {
  display: flex;
  flex: 1;
  justify-content: flex-end;
  padding-top: 10px;
  position: relative;
  right: 8px;
  bottom: 8px;
}
.debugger-bp-dialog {
  font-family: -apple-system, BlinkMacSystemFont, "helvetica neue", "Ubuntu", "Segoe UI", sans-serif;
  font-size: 12pt;
}
.debugger-breakpoint-separator {
  margin: 4px 0px 1px 0px;
}
